-- ************************
-- * Creo la tabla puntos *
-- ************************

CREATE TABLE public.puntos
(
    id integer,
    geom geometry,
    comuna numeric,
    barrio character varying(254),
	valor_mts2 numeric, 
	metrobus numeric, 
	subtes numeric,
	trenes numeric,
	educacion numeric,
	universidades numeric, 
	centros_salud numeric,
	boliches numeric,
	cines numeric,
	shoppings numeric,
	restaurantes numeric,
	clubes numeric, 
	polideportivos numeric,
	homicidios numeric,
	robos numeric,
	soltero numeric,
	pareja numeric, 
	familia numeric,
	PRIMARY KEY (id)
)
WITH (
    OIDS = FALSE
)
TABLESPACE pg_default;

ALTER TABLE public.puntos
    OWNER to postgres;
	
	
